import React from "react";
import cities from "../json/cities.json";
function Dropdown() {
  return (
    <div>
      ;
      <button
        className="btn btn-secondary dropdown-toggle"
        type="button"
        data-bs-toggle="dropdown"
        aria-expanded="false"
      >
        Cities
      </button>
      <div className="dropdown-menu">{cities}</div>
    </div>
  );
}

export default Dropdown;
